import React from "react";
import { Flex } from "rebass";
import { theme } from "../theme";

const Container = ({ children }) => {
  return (
    <Flex
      flexDirection="column"
      bg={theme.colors.jet}
      overflowX="hidden"
      width="100%"
    >
      {children}
    </Flex>
  );
};

export default Container;
